description:
it all started on a nice, bright and sunny day. Sirius, an arrogant brat, gets thrown out of his house by his father after a squabble. Now he gets set to take revenge of this petty disgrace. He takes his battle ship and heads into the ocean. The spoilt child now has to perform tasks like escorting merchant ships safely to ports, trading items and fighting off magical creatures. He needs to put away his pride and act all goody-goody to secure contracts.
